export default function GenderSelect({
  onBack,
  onComplete,
  initialStep = 1,
  totalSteps = 3,
}: {
  onBack?: () => void;
  onComplete?: (gender: Gender) => void;
  initialStep?: number;
  totalSteps?: number;
}) {
  const [selected, setSelected] = useState<Gender | null>(null);
  const [currentStep, setCurrentStep] = useState<number>(initialStep);

  // For keyboard navigation
  const cardsOrder: Gender[] = ["male", "female", "other"];
  const maleRef = useRef<HTMLButtonElement | null>(null);
  const femaleRef = useRef<HTMLButtonElement | null>(null);
  const otherRef = useRef<HTMLButtonElement | null>(null);

  const refMap = {
    male: maleRef,
    female: femaleRef,
    other: otherRef,
  };

  function choose(g: Gender) {
    setSelected(g);
    refMap[g].current?.focus();
  }

  function handleContinue() {
    if (!selected) return;
    setCurrentStep((s) => Math.min(totalSteps, s + 1));
    onComplete?.(selected);
  }

  function onCardKeyDown(e: React.KeyboardEvent, idx: number) {
    if (e.key === "ArrowRight" || e.key === "ArrowDown") {
      e.preventDefault();
      const next = (idx + 1) % cardsOrder.length;
      refMap[cardsOrder[next]].current?.focus();
    } else if (e.key === "ArrowLeft" || e.key === "ArrowUp") {
      e.preventDefault();
      const prev = (idx - 1 + cardsOrder.length) % cardsOrder.length;
      refMap[cardsOrder[prev]].current?.focus();
    } else if (e.key === "Enter" || e.key === " ") {
      e.preventDefault();
      choose(cardsOrder[idx]);
    }
  }

  function cardClass(g: Gender) {
    const base =
      "flex flex-col items-start gap-2 p-4 rounded-2xl border transition-shadow transform-gpu focus:outline-none";
    const selectedClass = "bg-orange-50 border-orange-400 shadow-lg scale-101";
    const normal = "bg-white border-gray-200 hover:shadow-sm";
    return `${base} ${selected === g ? selectedClass : normal}`;
  }

  return (
    <div className="w-full max-w-md mx-auto">
      {/* progress */}
      <div className="mb-6">
        <ProgressBar currentStep={currentStep} totalSteps={totalSteps} />
      </div>

      <h3 className="text-2xl font-bold mb-2">What is your gender?</h3>
      <p className="text-sm text-gray-500 mb-6">
        This help us find you more relevant content
      </p>

      <div
        className="grid grid-cols-2 gap-4 mb-4"
        role="listbox"
        aria-label="Gender options"
      >
        {/* Male */}
        <button
          ref={maleRef}
          role="option"
          aria-selected={selected === "male"}
          aria-label="Male"
          tabIndex={0}
          onKeyDown={(e) => onCardKeyDown(e, 0)}
          onClick={() => choose("male")}
          className={cardClass("male")}
        >
          <div
            className={`text-sm font-medium ${
              selected === "male" ? "text-orange-500" : "text-gray-500"
            }`}
          >
            Male
          </div>
          <div className="w-full h-28 overflow-hidden">
            <MaleSVG />
          </div>
        </button>

        {/* Female */}
        <button
          ref={femaleRef}
          role="option"
          aria-selected={selected === "female"}
          aria-label="Female"
          tabIndex={0}
          onKeyDown={(e) => onCardKeyDown(e, 1)}
          onClick={() => choose("female")}
          className={cardClass("female")}
        >
          <div
            className={`text-sm font-medium ${
              selected === "female" ? "text-orange-500" : "text-gray-500"
            }`}
          >
            Female
          </div>
          <div className="w-full h-28 overflow-hidden">
            <FemaleSVG />
          </div>
        </button>
      </div>

      {/* Other */}
      <button
        ref={otherRef}
        role="option"
        aria-selected={selected === "other"}
        aria-label="Other"
        tabIndex={0}
        onKeyDown={(e) => onCardKeyDown(e, 2)}
        onClick={() => choose("other")}
        className={`${cardClass("other")} w-full mb-6`}
      >
        <div
          className={`flex-1 text-center text-sm font-medium ${
            selected === "other" ? "text-orange-500" : "text-gray-500"
          }`}
        >
          Other
        </div>
        <div className="w-full h-12 overflow-hidden">
          <OtherSVG />
        </div>
      </button>

      <div className="flex flex-col gap-3">
        <Button
          className="w-full py-3"
          onClick={handleContinue}
          disabled={!selected}
        >
          Continue
        </Button>

        <button
          type="button"
          onClick={() => onBack?.()}
          className="w-full text-center text-sm text-gray-600 py-2 rounded"
        >
          Back
        </button>
      </div>
    </div>
  );
}
